import * as React from 'react'

export default function PokemonList(props) {

  return (
    <div>
      <h1>List of pokemon</h1>
      <ul>

        {props.pokemons && props.pokemons.map(pokemon =>
          <li key={pokemon.id}>
            <div onClick={() => props.showDetails(pokemon.name)}>{pokemon.id}: {pokemon.name}</div>
          </li>
        )}
      </ul>
    </div>
  )
}
